//static WM_MESSAGE lpMsg;
static void _cbWin(WM_MESSAGE * pMsg) {
	switch (pMsg->MsgId) {
	case WM_TIMER:
		/*
		... restart timer and invalidate window to update widgets ...
		*/
		WM_RestartTimer(hNewTimer, 100);
		if (WM_IsWindow(hWinSysStatus_hdl))
		{
        WM_Invalidate(hWinSysStatus_hdl);
		}
		break;
	default:
		WM_DefaultProc(pMsg);
	}
}



/*********************************************************************
*
*       _cbDialog
*/
static void _cbDialog(WM_MESSAGE * pMsg) {
  const void * pData;
  WM_HWIN      hItem;
  U32          FileSize;
  int          NCode;
  int          Id;
	static uint32_t t_dbglog=0;
	static uint32_t t_blinkSF=0,t_blinkPB,t_blinkFan;
	static bool bTogSF,bTogPB,bTogFan;
	
  // USER START (Optionally insert additional variables)
  // USER END

  switch (pMsg->MsgId) {
  case WM_INIT_DIALOG:
		//
    // Initialization of 'Window'
    //
    hItem = pMsg->hWin;
    WINDOW_SetBkColor(hItem,GUI_BLACK); //GUI_MAKE_COLOR(0x00454545));
    
    //
    // Initialization of 'txtROOM'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_0);
    TEXT_SetFont(hItem, GUI_FONT_D48X64);
    TEXT_SetTextColor(hItem, GUI_MAKE_COLOR(0x00EC1813));
    TEXT_SetText(hItem, "55");
    //
    // Initialization of 'txtLblRoom'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_1);
	  sprintf(dbglog,"ROOM         App v%d.%d.%d %d-%d-%d %d:%d", MAJVER,MINVER,BLDVER,YERVER,MONVER,DAYVER,HRSVER,MNSVER);
    TEXT_SetText(hItem, dbglog);

    TEXT_SetFont(hItem, GUI_FONT_13_1);
    //
    // Initialization of 'txtCOND'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_2);
    TEXT_SetText(hItem, "32");
    TEXT_SetFont(hItem, GUI_FONT_D48X64);
    TEXT_SetTextColor(hItem, GUI_MAKE_COLOR(0x00336A15));
    //
    // Initialization of 'txtLblACOIL'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_3);
    TEXT_SetText(hItem, "COIL");
    TEXT_SetFont(hItem, GUI_FONT_13_1);
    //
    // Initialization of 'radioMode'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_RADIO_0);
    RADIO_SetText(hItem, "MAN", 0);
    RADIO_SetText(hItem, "AUTO", 1);
    RADIO_SetFont(hItem, GUI_FONT_16B_1);
    RADIO_SetTextColor(hItem, GUI_MAKE_COLOR(0x000073E6));
    //
    // Initialization of 'Image'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_0);
    pData = _GetImageById(ID_IMAGE_0_IMAGE_0, &FileSize);
    IMAGE_SetBMP(hItem, pData, FileSize);
    //
    // Initialization of 'Image'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_1);
    pData = _GetImageById(ID_IMAGE_1_IMAGE_0, &FileSize);
    IMAGE_SetBMP(hItem, pData, FileSize);
    //
    // Initialization of 'Image'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_2);
    pData = _GetImageById(ID_IMAGE_2_IMAGE_0, &FileSize);
    IMAGE_SetBMP(hItem, pData, FileSize);
    //
    // Initialization of 'btnPwr'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_BUTTON_0);
    BUTTON_SetText(hItem, "Power");
		WM_HideWindow(hItem);			/*vk, hide button I am not using it yet*/
		
		hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_4);
    TEXT_SetTextColor(hItem, GUI_MAKE_COLOR(0x000000FF));
    TEXT_SetText(hItem, "Debug Log");
    TEXT_SetTextAlign(hItem, GUI_TA_LEFT | GUI_TA_BOTTOM);
    TEXT_SetFont(hItem, GUI_FONT_13_1);
    //
    // Initialization of 'prgWarmup'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_PROGBAR_0);
    PROGBAR_SetFont(hItem, GUI_FONT_6X8);
    
		hNewWin = WM_CreateWindow(1, 1, 1, 1, WM_CF_SHOW, _cbWin, 0);
	  WM_HideWindow(hNewWin);
		hNewTimer = WM_CreateTimer(hNewWin, 0, 1000, 0);
		
		//
    // Initialization of 'txtSet'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_SET);
    TEXT_SetTextAlign(hItem, GUI_TA_RIGHT | GUI_TA_VCENTER);
    TEXT_SetTextColor(hItem, GUI_MAKE_COLOR(0x00C2303F));
    TEXT_SetText(hItem, "--");
    //
    // Initialization of 'txtOpMode'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_OP);
    TEXT_SetTextAlign(hItem, GUI_TA_RIGHT | GUI_TA_VCENTER);
    TEXT_SetTextColor(hItem, GUI_MAKE_COLOR(0x00B52830));
    TEXT_SetText(hItem, "OFF");
    
		
    break;
  case WM_NOTIFY_PARENT:
    Id    = WM_GetId(pMsg->hWinSrc);
    NCode = pMsg->Data.v;
    switch(Id) {
    case ID_TEXT_0: // Notifications sent by 'text_ID0'
      switch(NCode) {
      case WM_NOTIFICATION_CLICKED:
				ctldata_s.acCoolTemps.dmd = ctldata_s.acCoolTemps.dmd +1.00;
			  if(ctldata_s.acCoolTemps.dmd >= 75.00){
					ctldata_s.acCoolTemps.dmd = 55.00;
				}
        break;
      }
      break;
				
		case ID_IMAGE_2: // Notifications sent by 'power icon'
  	break;
    
			
    }
    break;
		
case WM_PAINT:
			/*update room temp*/
      sprintf(dispstr,"%2.0f",ctldata_s.acCoolTemps.rdb);
			hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_0);
			TEXT_SetText(hItem, dispstr);
			
			/*update condensor temp*/
			sprintf(dispstr,"%2.0f",ctldata_s.condCoil.rdb);
			hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_2);
			TEXT_SetText(hItem, dispstr);
			if(ctldata_s.bFrostErr == FALSE){
					TEXT_SetTextColor(hItem,GUI_DARKGREEN);
			}else{
					TEXT_SetTextColor(hItem,GUI_RED);
			}
			
			
			/* Show OR Blink COOL mode based on AcCooling status*/
			hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_0);
			if(ctldata_s.bAcCooling == TRUE){
							WM_ShowWindow(hItem);			
			}else{
					/* Blink Snow Flake */
				if((t_blinkSF + 500) < GUI_GetTime()){
						t_blinkSF = GUI_GetTime();
					  if(bTogSF){
							bTogSF = FALSE;
							WM_ShowWindow(hItem);
						}else{
							bTogSF = TRUE;
							WM_HideWindow(hItem);
						}
				}
			}		
			
			
			/* Show OR Blink Power Button IMG based on bFrostErr status*/
			hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_2);
			if(ctldata_s.bFrostErr == FALSE){
							WM_ShowWindow(hItem);			
			}else{
					/* Blink IMG */
				if((t_blinkPB + 500) < GUI_GetTime()){
						t_blinkPB = GUI_GetTime();
					  if(bTogPB){
							bTogPB = FALSE;
							WM_ShowWindow(hItem);
						}else{
							bTogPB = TRUE;
							WM_HideWindow(hItem);
						}
				}
			}
			
			/* Show OR Blink Fan IMG based on bModeCool status*/
			hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_1);
			if(ctldata_s.dmdmode_e == EDMDMD_COOL){
							WM_ShowWindow(hItem);			
			}else{
					/* Blink IMG */
				if((t_blinkFan + 500) < GUI_GetTime()){
						t_blinkFan = GUI_GetTime();
					  if(bTogFan){
							bTogFan = FALSE;
							WM_ShowWindow(hItem);
						}else{
							bTogFan = TRUE;
							WM_HideWindow(hItem);
						}
				}
			}
			
			/*Once per second Push the dbglog out if lgo info, else update UPTIME*/
			if((t_dbglog + 1000) < GUI_GetTime()){
					t_dbglog = GUI_GetTime();
					hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_4);
					if(strlen(dbglog)>0){
						TEXT_SetTextColor(hItem, GUI_RED);
						TEXT_SetText(hItem, dbglog);
						memset(dbglog,0,sizeof(dbglog));
					}else{
							/*update uptime*/
							TEXT_SetTextColor(hItem, GUI_BLACK);
							TEXT_SetText(hItem,time_s.str);
					}
			}
			
			/*update progbar*/
			hItem = WM_GetDialogItem(pMsg->hWin, ID_PROGBAR_0);
			if(ctldata_s.ucWarmPcnt < 5u || ctldata_s.bFrostCheck ){
					WM_HideWindow(hItem);			
			}else{
					WM_ShowWindow(hItem);			
					PROGBAR_SetValue(hItem,(int)ctldata_s.ucWarmPcnt);
			}
			
			 
			sprintf(dispstr,"%2.0f",ctldata_s.acCoolTemps.dmd);
			hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_SET);
			TEXT_SetText(hItem, dispstr);
    
		  memset(dispstr,'\0',sizeof(dispstr));
			if(ctldata_s.ctlmode_e == ECTLMD_OFF){
					strcpy(dispstr, "OFF");
			}else if(ctldata_s.ctlmode_e == ECTLMD_TSTAT){
					strcpy(dispstr,"TSTAT");
			}else if(ctldata_s.ctlmode_e == ECTLMD_REMOTE){
					strcpy(dispstr,"REMOTE");
			}else if(ctldata_s.ctlmode_e == ECTLMD_MANUAL){
					strcpy(dispstr,"MANUAL");
			}else{
					strcpy(dispstr, "OFF");
			}
			
			hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_OP);
			TEXT_SetText(hItem, dispstr);
			
     break;

  default:
    WM_DefaultProc(pMsg);
    break;
  }
}

